import {React , Component} from 'react';
import  { FaHtml5 , FaCss3 , FaReact , Icon} from 'react-icons/fa';
import { Axios } from 'axios';
import './style.css'


class Work extends Component {

  state = {
    works : []
  }

  componentDidMount(){
    axios.get('json/data.json').then(res =>{ this.setState({works : res.data.works})})
  }

    render(){
      const {works} = this.state;

      const worklists= works.map((worklist) =>{
        return (
          <div className='work-box'>
             <div>
               <FaCss3  />
               <h3>{worklist.title}</h3>
               <hr />
             </div>
             <p>{worklist.info}</p>
         </div>
        )
      })

      return(
        <section className='container'>
        <h2 className='sec-header'> My Work</h2>
        <div className='work-container'>
         {
          this.worklists
         }
         
        </div>
     </section>
      )
    }
}

export default Work ;
